import React, {useContext, useState} from 'react';
import {observer} from "mobx-react-lite";
import {Context} from "../index";
import {Row} from "react-bootstrap";
import OrderItem from "./OrderItem";
import {useNavigate} from "react-router-dom";
import {ORDER_ROUTE} from "../utils";

const OrderList = observer( ({dateRange}) => {
    const {order} = useContext(Context)
    const navigate = useNavigate()

    const [filteredOrders,setFilteredOrders] = useState([])

    const filterOrder = () =>{
        let startDate = Date.parse(dateRange[0])
        let endDate = Date.parse(dateRange[1])

        order.orders.forEach( i =>{
            let checkDate = Date.parse(i.createdAt)
            //if(checkDate > )
        })

    }
    if(dateRange){

    }

    return (
        <Row className="d-flex mt-5" >

            {order.orders.map(orderCur =>
                <div
                    key={orderCur.id}
                    onClick={() => navigate(ORDER_ROUTE + '/' + orderCur.id)}
                    style={{cursor:"pointer"}}
                >
                    {console.log(Date.parse(dateRange[0]))}
                    {console.log(Date.parse(dateRange[1]))}


                    <OrderItem


                        orderCur={orderCur}
                    />
                </div>

            )}

        </Row>

    );
});

export default OrderList;
